import React from 'react';
import './Commands.css'
import { Card } from 'semantic-ui-react'

const commands = [
  {
    header: '//핑',
    description: '봇의 핑을 알려줍니다.'
  },
  {
    header: '//봇정보',
    description: '봇의 정보를 보여줍니다.'
  },
  {
    header: '//청소 (개수)',
    description: '채팅창을 청소 합니다.'
  },
  {
    header: '//추방 (유저)',
    description: '유저를 추방합니다.'
  },
  {
    header: '//밴 (유저)',
    description: '유저를 밴합니다.'
  },
  {
    header: '//뮤트 (유저)',
    description: '유저를 뮤트합니다. Muted라는 역할이 있어야 합니다.'
  },
  {
    header: '//언뮤트 (유저)',
    description: '유저를 뮤트를 해제합니다.'
  },
  {
    header: '//play (Url 또는 검색어)',
    description: 'Url이나 검색어를 음성채널에서 플레이 해줍니다.'
  },
  {
    header: '//stop',
    description: '재생중이던 음악을 정지합니다.'
  },
  {
    header: '//skip',
    description: '재생중이던 음악을 중지하고 대기열에 있는 다음 노래를 듣습니다.'
  },
  {
    header: '//np',
    description: '현재 재생중인 곡의 정보를 보여줍니다.'
  },
  {
    header: '//seek (초)',
    description: '(초) 만큼 시간 스킵이 됩니다.'
  },
  {
    header: '//loop',
    description: '현재 재생중인 곡을 반복합니다.'
  },
  {
    header: '//v (숫자)',
    description: '(숫자) 만큼 볼륨이 조정되거나, (숫자) 가 없다면 현재 볼륨을 보여줍니다.'
  },
  {
    header: '//멜론',
    description: '멜론차트 Top 10 을 보여줍니다.'
  }
]

function Commands() {
  return (
    <div className='Commands'>
      <h1>명령어들</h1>
      <Card.Group items={commands} className='CommandsCard' />
    </div >
  );
}

export default Commands;
